pageContext.rootQuery:
query BlogPostQuery($uid: String) {
  prismic {
    allPosts(uid: $uid) {
      edges {
        node {
          post_body
          title
          category
          date
          excerpt
          tags {
            tag {
              _linkType
              ... on PRISMIC_Tag {
                name
                _linkType
              }
            }
          }
          image
        }
      }
    }
  }
}
